        <title>Untitled</title>
        <style>
            body {
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                margin: 0;
                padding: 0;
                overflow: hidden;
            }

            svg {
                display: none;
                filter: blur(0);
            }

            .sozi-frame-list {
                position: absolute;
                top: 0;
                right: 0;
                width: 33%;
                height: 100%;
                margin: 0;
                padding: 0.5em 1em 0.5em 0.25em;
                overflow-y: auto;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;

                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-frame-list ol {
                margin: 0;
                overflow-x: hidden;
            }

            .sozi-frame-list li {
                white-space: nowrap;
            }

            li.sozi-title-level-1:before { content: '. . ';             color: rgb(100, 100, 100); }
            li.sozi-title-level-2:before { content: '. . . . ';         color: rgb(100, 100, 100); }
            li.sozi-title-level-3:before { content: '. . . . . . ';     color: rgb(100, 100, 100); }
            li.sozi-title-level-4:before { content: '. . . . . . . . '; color: rgb(100, 100, 100); }

            .sozi-frame-list a {
                color: inherit;
                text-decoration: none;
            }

            .sozi-frame-list a:hover {
                color: rgb(0, 204, 255);
                text-decoration: underline;
            }

            .sozi-frame-list a.current {
                color: rgb(255, 170, 68);
            }

            .sozi-frame-number {
                position: absolute;
                top: 0;
                left: 1em;
                text-align: center;
                padding: 0.3em 0.6em;

                cursor: pointer;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;
                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-blank-screen {
                background: black;
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 100%;
                visibility: visible;
                z-index: 999;
                transition: opacity 0.5s, visibility 0.5s;
            }

            svg a {
                cursor: pointer;
            }

            @keyframes spinner {
                to { transform: rotate(360deg); }
            }

            .spinner:before {
                content: '';
                box-sizing: border-box;
                position: absolute;
                top: 50%;
                left: 50%;
                width: 40px;
                height: 40px;
                margin-top: -20px;
                margin-left: -20px;
                border-radius: 50%;
                border: 4px solid #ccc;
                border-top-color: #333;
                animation: spinner .8s linear infinite;
            }
        </style>
    </head>

    <g id="g40117" ns324:jacobian_sqrt="0.323077" ns324:inkscapeversion="1.0" ns324:alignment="middle center" ns324:scale="0.915807872979918" ns324:preamble="/home/carriunix/ensino/PSIbased/mathdefs.tex" ns324:text="\\begin{minipage}{12cm}\nFazendo $\\tau = C/\\delta$ e separando as vari\xe1veis na equa\xe7\xe3o anterior:\n\\begin{equation*}\n\\frac{\\mathrm{d} T}{T_2 - T(t)} = \\frac{\\mathrm{d}t}{\\tau}.\n\\end{equation*}\nIntegrando, obt\xeam-se:\n\\begin{equation*}\n\\ln\\left[ T_2 - T(t) \\right] = - \\frac{t}{\\tau}+p,\n\\end{equation*}\nonde $p$ \xe9 uma constante que depende das condi\xe7\xf5es iniciais. Para conhecermos seu valor, tomemos $t=0$. Teremos que\n\\begin{equation*}\np = \\ln\\left[ T_2 - T1 \\right].\n\\end{equation*}\nLogo, podemos escrever o modelo de medi\xe7\xe3o\n\\begin{equation}\n\\ln \\left[ \\frac{T_2 - T(t)}{T_2 - T_1} \\right] = - \\frac{t}{\\tau}.\n\\end{equation}\n\\end{minipage}\n" ns324:pdfconverter="inkscape" ns324:texconverter="pdflatex" ns324:version="1.1.0" transform="matrix(0.323077,0,0,0.323077,474.37575,154.08647)">

    <g transform="matrix(0.323077 0 0 0.323077 275.578 159.38)" ns324:version="1.1.0" ns324:texconverter="pdflatex" ns324:pdfconverter="inkscape" ns324:text="\\begin{minipage}{12cm}\nSe um term\xf4metro a temperatura inicial $T_1$ \xe9 colocado em um ambiente a temperatura $T_2$, ele absorve ou cede calor de acordo com a rela\xe7\xe3o:\n\\begin{equation*}\n\\Delta Q = C \\Delta T,\n\\end{equation*}\nsendo $C$ a capacidade t\xe9rmica do term\xf4metro. Essa equa\xe7\xe3o, quando analisada para varia\xe7\xf5es infinitesimais pode ser reescrita como\n\\begin{equation*}\n\\mathrm{d} Q = C \\mathrm{d} T.\n\\end{equation*}\nEssa quantidade de calor n\xe3o \xe9 trocada instantaneamente, mas de acordo com a equa\xe7\xe3o:\n\\begin{equation*}\n\\mathrm{d} Q = \\delta \\left[ T_2 - T(t) \\right] \\mathrm{d}t,\n\\end{equation*}\nonde $T(t)$ \xe9 a temperatura do term\xf4metro no  instante $t$ e $\\delta$ \xe9 uma quantidade proporcional \xe0 condutividade t\xe9rmica da parede do vidro do term\xf4metro. Portanto,\n\\begin{equation*}\nC \\mathrm{d} T = \\delta \\left[ T_2 - T(t) \\right] \\mathrm{d}t.\n\\end{equation*}\n\\end{minipage}" ns324:preamble="/home/carriunix/ensino/PSIbased/mathdefs.tex" ns324:scale="0.915807872979918" ns324:alignment="middle center" ns324:inkscapeversion="1.0" ns324:jacobian_sqrt="0.323077" id="g21527">
